// import logo from './logo.svg';
import './App.css';

function HeaderTag() {
  return (
    <header>
      <h1>React Sample Page</h1>
    </header>
  )
}

function Nav() {
  return (
    <nav>
      <ol>
        <li>html</li>
        <li>css</li>
        <li>js</li>
      </ol>
    </nav>
  )
}

function Article(props) {
  return (
  <article>
    <h2>{props.title}</h2>
    {props.body}
  </article>)
}


function App() {

  return (
    <>
    <HeaderTag />
    <Nav />
    <Article title='강수빈 내일 출근' body='화이팅'/>
    </>
    );
}

export default App;
